import React from 'react';

const BusinessSnapshot = () => {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
      <div className="bg-white border border-gray-300 shadow-sm rounded-lg p-4">
        <p className="text-gray-600 text-sm">Shipped Revenue</p>
        <p className="text-xl font-bold text-gray-900 mt-1">$97.86</p>
      </div>
      <div className="bg-white border border-gray-300 shadow-sm rounded-lg p-4">
        <p className="text-gray-600 text-sm">Open PO Qty</p>
        <p className="text-xl font-bold text-gray-900 mt-1">0</p>
      </div>
      <div className="bg-white border border-gray-300 shadow-sm rounded-lg p-4">
        <p className="text-gray-600 text-sm">On Hand Units</p>
        <p className="text-xl font-bold text-gray-900 mt-1">767</p>
      </div>
    </div>
  );
};

export default BusinessSnapshot;
